import React, { Component } from 'react';
class Homepage extends Component
{
    constructor()
    {
        super(); 

        console.log(this.props.details)
    }
    
    render()
    {
        return(
            <div>
            
            <h1>Hello, {this.props.details}</h1>
            </div>
        );

    }
}
export default Homepage;
